import React from 'react'
import "./stylesheets/App.css"
import Home from "./Containers/Home";


class App extends React.Component {

    state = {
        current_href: ''
    }


    onClickHandler = (page) => {
        console.log(page)
    }


    render() {
        return (
            <div id="navbar" href={this.state.current_href}>
                <Home onClickHandler={this.onClickHandler}/>
            </div>
        );
    }

}

export default App
